INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 322, 126001, 1, 24001, "クリア", 2, 1, 40011, 2);
