INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 325, 126001, 1, 24001, "クリア", 5, 2, 40011, 2);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, "お兄。\nきてくれて、うれしい", 326, 126101, 1, 24001, "プレシア", 6, 2, 40011, 2);
